%[text] # Using uDALES utilities in MATLAB
%[text] This tutorial demonstrates how to use the uDALES MATLAB utilities for post-processing simulation data. We'll cover: 1. Merging short-term time-averaged data to long-term,  2. Spatial filtering (coarse-graining method). Specifically, including the functions:
%[text] -  [**merge\_stat\_var**](internal:M_6c19)**.** This method merge long-term time average for a single variable and its variance.
%[text] -  [**merge\_stat\_cov**](internal:M_6c19)**.** This method merge long-term time average for two variables and their covariance.
%[text] -  [**coarse\_graining**](internal:M_2c34)**.** This method using FFT to spatial averaging a field using a squared filter \[1\]. \
%[text] ## Initialising udbase and loading data
% preamble
clear variables
close all

% add the uDALES matlab path
% addpath('C:\Users\mvr\OneDrive - Imperial College London\codes\uDALES\u-dales\tools\matlab')
addpath('E:\uDALES\u-dales-enhance-udbase-udgeom-integration\tools\matlab')

% create an instance of the udbase class
expnr = 110;  % Experiment number (corresponds to namoptions.110)
expdir = 'E:\uDALES\jh6016c\work\110';  % Path to simulation directory

sim = udbase(expnr, expdir); %[output:8d49adbc]
%%
%[text] %[text:anchor:M_6c19] ## Combining short-term time average to long-term time average 
%[text] Load short-term time-averaged data, for example the 1-D plane average
uxyt = sim.load_stat_xyt('uxyt');       % u-velocity profile (z) [m/s]
wxyt = sim.load_stat_xyt('wxyt');       % w-velocity profile [m/s]
upupxyt = sim.load_stat_xyt('upuptxyc'); % u-velocity variance [m²/s²]
upwpxyt = sim.load_stat_xyt('upwpxyt'); % u-w velocity covariance [m²/s²]
time = sim.load_stat_xyt('time');       % Time coordinate for xyt data [s]
%[text] Check the averaging time interval
time %[output:0b56ab38]
length(time) %[output:3b3148d7]
%[text] Long-term time averaging for a single variable can be obtained by using
% over entire time series

% for u-velocity only
[uxyt_longterm, ~] = merge_stat_var(uxyt, zeros(size(uxyt)), length(time)); % the last dimension for the input short-term average must be the time.
% for u-velocity and its variance
[uxyt_longterm, upupxyt_longterm] = merge_stat_var(uxyt, upupxyt, length(time));

% check the dimension
size(uxyt) %[output:1d64fc6e]
size(uxyt_longterm) %[output:0247c0aa]

% over a specific time window

Nwindow = 2;  % Number of consecutive time steps to average together
% in this example, the average are taken using the last two time-series
% data, see function merge_stat_va for details.
[uxyt_longterm, upupxyt_longterm] = merge_stat_var(uxyt, upupxyt, Nwindow);

% check the dimension:
% The last dimension(time) has been averaged
size(uxyt) %[output:80ef84dc]
size(uxyt_longterm) %[output:480f8057]
%[text] Long-term time averaging for variables and their covariance can be obtained by using
% over entire time series

[uxyt_longterm, wxyt_longterm, upwpxyt_longterm] = merge_stat_cov(uxyt, wxyt, upwpxyt, length(time));

size(upwpxyt) %[output:0bd434b5]
size(upwpxyt_longterm) %[output:66a4f1d1]

% over a specific time window

[uxyt_longterm, wxyt_longterm, upwpxyt_longterm] = merge_stat_cov(uxyt, wxyt, upwpxyt, Nwindow);
size(upwpxyt) %[output:1baf8637]
size(upwpxyt_longterm) %[output:688d5c46]
%[text] 
%%
%[text] %[text:anchor:M_2c34] ## Coarse-graining Method
% Apply spatial filters to smooth field data at different length scales
% This is useful for multi-scale analysis

ut = sim.load_stat_t('ut'); % load 3-D a field
% Use last two time interval to merge to one long-term time average
ut_longterm = merge_stat_var(ut, zeros(size(ut)), 2);

filter_lengths = [8, 32, 128];  % Filter widths in meters

u_filtered = coarse_graining(ut_longterm, filter_lengths, sim.dx, sim.xm, sim.ym); %[output:2b957b38]

% Create figure with subplots comparing original and filtered fields

figure %[output:313a46e3]
k_level = 10;
% Original field (unfiltered)
subplot(2,2,1) %[output:313a46e3]
pcolor(sim.xt, sim.yt, ut(:,:,k_level)');  %[output:313a46e3]
shading flat; axis equal tight; colorbar;  %[output:313a46e3]
clim([-1 2]) %[output:313a46e3]
title('Original Field (Unfiltered)') %[output:313a46e3]
xlabel('x [m]'); ylabel('y [m]'); %[output:313a46e3]

% Filtered fields with increasing filter lengths
filter_titles = {
    sprintf('Filter Length = %.0f m', filter_lengths(1)),
    sprintf('Filter Length = %.0f m', filter_lengths(2)), 
    sprintf('Filter Length = %.0f m', filter_lengths(3))
};

for i = 1:3 %[output:group:7d64367c]
    subplot(2,2,i+1) %[output:313a46e3]
    pcolor(sim.xt, sim.yt, u_filtered(:,:,k_level,i)'); 
    shading flat; axis equal tight; colorbar; 
    clim([-1 2])
    title(filter_titles{i})
    xlabel('x [m]'); ylabel('y [m]');
end %[output:group:7d64367c]
%%
%[text] ## References
%[text] \[1\] Maarten van Reeuwijk, Jingzi Huang (2025) Multi-scale Analysis of Flow over Heterogeneous Urban Environments, *Bound-Lay. Met.* **191**, 47.

